import React from 'react';
function Hero() {
    return ( 
        <div className='container'>
            <div className='row p-5'>
                <h1 className='fs-4'>We pioneered the discount broking model in India.
                Now, we are breaking ground with our technology.</h1>
            </div>
        </div>
    );
}

export default Hero
